import React, { Component } from "react";



function TaskList() {
    
    var apiData = {"data":{}};
    let p = fetch("http://127.0.0.1:8081/gettasks");
    
    let res =  p.then(response => {
        return response.text();
      });
      
    res.then(data => {
        apiData.data = data;
    });

    return JSON.stringify(apiData.data);

    // return <ul>{ listitems }</ul> ;
    
}

export default TaskList;
